import ReactDOM from "react-dom/client";
import "../src/index.css"
import Calculator from "./main/Calculator";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <h1>Calculator</h1>
    <Calculator />
  </React.StrictMode>
);
